'''HNoMS ''Stavanger''''' ([[pennant number]] F303) was an {{sclass-|Oslo|frigate}} of the [[Royal Norwegian Navy]].

''Stavanger'' was decommissioned in 1998. She was later used for [[Target ship|target practice]] and sunk in 2001 by a single DM2A3 [[torpedo]] launched from the {{sclass-|Ula|submarine}} ''Utstein''.

